import React, { Component } from "react";
import {
    Grid,
    Row,
    Col,
  } from "react-bootstrap";
import Card from "components/Card/Card.jsx";

class TravelAdvice extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <Row>
            <Col md={12}>
            <Card title="Widespread sustained (ongoing) transmission and restrictions on entry to the United States"
                content={
                    <div>
                        <p>CDC recommends that travelers avoid all nonessential travel to the following destinations. <br></br>Entry of foreign nationals from these destinations has been suspended.</p>
                        <ul>
                            <li>China (<a href="https://wwwnc.cdc.gov/travel/notices/watch/novel-coronavirus-china">Level 3 Travel Health Notice</a>)</li>
                            <li>Iran (<a href="https://wwwnc.cdc.gov/travel/notices/watch/coronavirus-iran">Level 3 Travel Health Notice</a>)</li>
                        </ul>
                    </div>






                }


            />
          </Col>
        </Row>
        <div class="row ">
          <div class="col-md-12">
            <div class="row-fluid">
              <div class="vc_empty_space col-12 pt-3 pb-1">
                <span class="vc_empty_space_inner"></span>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default TravelAdvice;
